            "to": "clo3d",
            "value": 23
        }, {"from": "fashionworld", "to": "fashionartist", "value": 23}, {
            "from": "3d",
            "to": "outfit",
            "value": 23
        }, {"from": "opensea", "to": "rendering", "value": 23}, {
            "from": "opensea",
            "to": "nftcollection",
            "value": 23
        }, {"from": "opensea", "to": "nftcollectibles", "value": 23}, {
            "from": "artist",
            "to": "render",
            "value": 23
        }, {"from": "substance", "to": "3dfashion", "value": 23}, {
            "from": "digitalillustration",
            "to": "digital",
            "value": 23
        }, {"from": "3dmodel", "to": "virtualfashion", "value": 23}]);

        // adding nodes and edges to the graph
        data = {nodes: nodes, edges: edges};

        var options = {
            "configure": {
                "enabled": true
            },
            "edges": {
                "color": {
                    "inherit": true
                },
                "smooth": {
                    "enabled": false,
                    "type": "continuous"
                }
            },
            "interaction": {
                "dragNodes": true,
                "hideEdgesOnDrag": false,
                "hideNodesOnDrag": false
            },
            "physics": {
                "barnesHut": {
                    "avoidOverlap": 0,
                    "centralGravity": 0.3,
                    "damping": 0.09,
                    "gravitationalConstant": -80000,
                    "springConstant": 0.001,
                    "springLength": 250
                },
                "enabled": true,
                "stabilization": {
                    "enabled": true,
                    "fit": true,
                    "iterations": 1000,
                    "onlyDynamicEdges": false,
                    "updateInterval": 50
                }
            }
        };


        // if this network requires displaying the configure window,
        // put it in its div
        options.configure["container"] = document.getElementById("config");


        network = new vis.Network(container, data, options);


        network.on("stabilizationProgress", function (params) {
            document.getElementById('loadingBar').removeAttribute("style");
            var maxWidth = 496;
            var minWidth = 20;
            var widthFactor = params.iterations / params.total;
            var width = Math.max(minWidth, maxWidth * widthFactor);

            document.getElementById('bar').style.width = width + 'px';
            document.getElementById('text').innerHTML = Math.round(widthFactor * 100) + '%';
        });
        network.once("stabilizationIterationsDone", function () {
            document.getElementById('text').innerHTML = '100%';
            document.getElementById('bar').style.width = '496px';
            document.getElementById('loadingBar').style.opacity = 0;
            // really clean the dom element
            setTimeout(function () {
                document.getElementById('loadingBar').style.display = 'none';
            }, 500);
        });


        return network;

    }

    drawGraph();
